// src/components/NavBar.js
import React from 'react';


const NavBar = ({ onNavigate }) => {
  return (
    <header id="header" className="fixed-top d-flex align-items-center">
      <div className="container d-flex justify-content-between align-items-center">
        <h1 className="logo" onClick={() => onNavigate('home')}>SkillLens</h1>
        <nav id="navbar" className="navbar">
          <ul>
            <li><a className="nav-link" onClick={() => onNavigate('home')}>Home</a></li>
            <li><a className="nav-link" onClick={() => onNavigate('about')}>About</a></li>
            <li><a className="nav-link" onClick={() => onNavigate('services')}>Services</a></li>
          </ul>
        </nav>
        <a href="#services" className="get-started-btn" onClick={() => onNavigate('services')}>Get Started</a>
      </div>
    </header>
  );
};

export default NavBar;
